import React from "react";
import "../styles/Experience.css";

function Experience() {
  const timelineData = [
    {
      year: "2023",
      title: "Started Learning Web Development",
      description:
        "Began with HTML, CSS, and JavaScript. Created my first static websites and fell in love with frontend development.",
    },
    {
      year: "2024",
      title: "Joined Bano Qabil Incubation",
      description:
        "Enrolled in Bano Qabil’s program and worked on real-world dev projects. Learned React, Next.js, and advanced UI techniques.",
    },
    {
      year: "2025",
      title: "Built My Dream Portfolio",
      description:
        "Applied everything I learned to design and build this animated, responsive portfolio showcasing my growth as a developer.",
    },
  ];

  return (
    <section className="experience-section" id="experience">
      <h2 className="experience-heading">Experience Timeline</h2>
      <div className="timeline">
        {timelineData.map((item, index) => (
          <div className="timeline-item" key={index}>
            <div className="timeline-dot" />
            <div className="timeline-content">
              <h3>
                {item.year} — {item.title}
              </h3>
              <p>{item.description}</p>
            </div>
          </div>
        ))}
      </div>
    </section>
  );
}

export default Experience;
